import React from "react";
import { solutionList } from "../Data/objectData";

const SolutionComponent = () => {
  const styles = {
    container: {
      position: "relative",
    },
    titleText: {
      fontWeight: "700",
      fontSize: "64px",
      textAlign: "center",
    },
    titleSolution: {
      fontSize: "32px",
      fontWeight: "600",
    },
    detailConteniner: {
      display: "flex",
      justifyContent: "center",
      alignItems: "center",
      flexDirection: "column",
      marginTop: "20px",
    },
    borderBox: {
      border: "1.49803px solid #FFFFFF",
      position: "absolute",
      //   left: "10%",
      //   right: "10%",
      width: "1160px",
      top: "15%",
      bottom: "0",
      transform: "translate(0%,50%)",
    },
  };

  const displayBorderBox = <div style={styles.borderBox} />;

  const displayContent = (
    <div className="d-flex justify-content-center flex-nowrap">
      {solutionList?.map((item) => {
        return (
          <div>
            <img src={item.imgPath} alt={item.title} />
            <div style={styles.detailConteniner}>
              <div style={styles.titleSolution}>{item.label}</div>
              <div>
                <ul>
                  {item.list?.map((el) => {
                    return <li>{el}</li>;
                  })}
                </ul>
              </div>
            </div>
          </div>
        );
      })}
    </div>
  );

  return (
    <div className="my-4">
      <div style={styles.titleText}>SOLUTION</div>
      <div className="container-fluid" style={styles.container}>
        {displayBorderBox}
        {displayContent}
      </div>
    </div>
  );
};

export default SolutionComponent;
